import AppLayout from "../components/AppLayout";
import { Card } from 'antd';
const { Meta } = Card;

const NewLook = () => {
    return(
        <AppLayout>
            <h1>New DailyLook</h1>
            <section>
            <Card
                style={{
                width: 240,
                }}
                cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
             >
  </Card>
            </section>
        </AppLayout>
    );
};

export default NewLook;
